import React, { useEffect } from "react"

function Gallery(props) {

    // Filters pepes
    let filteredWallet = []
    function filter(wallet) {
        let cache = []
        wallet.forEach((asset) => {
            console.log(asset.props["series"])
            if(asset.props["series"] == (props.pepeFilter.original || props.pepeFilter.fake)) {
                cache.append(asset.props)
            }
        })

        return cache
    }
    filteredWallet = filter(props.wallet)

    return (
        <div className="gallery">
            {/* {props.wallet} */}
            {filteredWallet}
        </div>
    )
}

export default Gallery
